    __webpack_exports__["default"] = "<ion-header>\n  <ion-toolbar color=\"primary\">\n    <ion-buttons slot=\"end\">\n      <ion-button (click)=\"dismiss()\" color=\"light\">Close</ion-button>\n    </ion-buttons>\n    <ion-title> Privacy Policy </ion-title>\n  </ion-toolbar>\n</ion-header>\n\n<ion-content class=\"legal-content\">\n  <h3 class=\"legal-title\">PRIVACY & RETURN POLICIES</h3>\n  <p class=\"legal-text\">\n    Your privacy is important to AfrimartOne.ng and always have been. So we've\n    developed a Privacy Policy that covers how we collect, use, disclose,\n    transfer, and store your information. Please take a moment to familiarize\n    yourself with our privacy practices and let us know if you have any\n    questions.\n    <br />\n    By visiting AfrimartOne.ng, you are accepting the practices described in\n    this Privacy Notice.\n    <br />\n    Overview:\n    <br />\n    1. How Personal Information about Customers is used?<br />\n    2. What Personal Information about Customers does AfrimartOne.ng Gather?<br />\n    3. What about Cookies?<br />\n    4. What is the accuracy of the Personal data provided to AfrimartOne.ng?<br />\n    5. How Secure is Information about Me?<br />\n    6. Examples of Information Collected<br />\n    7. Other Businesses<br />\n  </p>\n  <h3 class=\"legal-title\">\n    1. How Personal Information about Customers is used?\n  </h3>\n  <p class=\"legal-text\">\n    User data may be shared with AfrimartOne.ng providers to improve order\n    processing and customer service. It may also be used both for marketing\n    research purposes and customer relation management, it being specified that\n    some of those providers are not located in the European Union.\n  </p>\n  <h3 class=\"legal-title\">2. What is done with your personal information?</h3>\n  <p class=\"legal-text\">\n    User data collected helps us to personalize our website according to each\n    user wishes and preferences. Offering you the most spontaneous and friendly\n    surfing experience is our priority. Data collected are for statistical\n    purposes only and help us to:<br /><br />\n\n    • Process orders<br />\n    • Deliver products and services<br />\n    • Process payments and communicate with you about your orders, products,\n    services and promotional offers<br />\n    • Keep and update our database and your accounts with us<br />\n    • Propose a unique and targeted navigation experience<br />\n    • Prevent and detect fraud and abuse on our website<br /><br />\n    By completing an order or signing up, you agree to receive<br /><br />\n    • Emails associated with finalizing your order, which may contain relevant\n    offers from third parties.<br />\n    • Emails asking you to review AfrimartOne.ng and your purchase.<br />\n    • Promotional emails, SMS and push notifications from AfrimartOne.ng.<br /><br />\n\n    You may unsubscribe from promotional emails via a link provided in each\n    mail. If you would like us to remove your personal information from our\n    database, unsubscribe from emails and/or SMS, please email Customer Service\n    email address by country.\n  </p>\n\n  <h3 class=\"legal-title\">3. What about Cookies?</h3>\n  <p class=\"legal-text\">\n    Cookies are unique identifiers that we transfer to your device to enable our\n    systems to recognize your device and to provide features to make your\n    navigation experience unique and targeted.<br />\n\n    The acceptance of cookies is not a requirement for visiting the Site.\n    However we would like to point out that the use of the 'basket'\n    functionality on the Site and ordering is only possible with the activation\n    of cookies.<br /><br />\n    Cookies are tiny text files which identify your computer to our server as a\n    unique user when you visit certain pages on the Site and they are stored by\n    your Internet browser on your computer's hard drive. Cookies can be used to\n    recognize your Internet Protocol address, saving you time while you are on,\n    or want to enter, the Site. We only use cookies for your convenience in\n    using the Site (for example to remember who you are when you want to amend\n    your shopping cart without having to re-enter your email address) and not\n    for obtaining or using any other information about you (for example targeted\n    advertising).<br /><br />\n    Your browser can be set to not accept cookies, but this would restrict your\n    use of the Site. Please accept our assurance that our use of cookies does\n    not contain any personal or private details and are free from viruses.<br />\n\n    AfrimartOne.ng uses Google Analytics for marketing and personal data\n    optimization purposes.<br />\n    AfrimartOne.ng also uses Google Digital Marketing to propose targeted\n    offers.<br />\n\n    To find out more: • About Google Analytics:<a\n      href=\"https://analytics.google.com/analytics/web/\"\n      target=\"_blank\"\n      >Click Here</a\n    >\n    • About Google Digital Marketing:<a\n      href=\"https://learndigital.withgoogle.com/digitalskills/course/digital-marketing\"\n      target=\"_blank\"\n    >\n      Click Here</a\n    >\n  </p>\n\n  <h3 class=\"legal-title\">\n    4. What is the accuracy of the Personal Data provided to AfrimartOne.ng?\n  </h3>\n  <p class=\"legal-text\">\n    You declare and guarantee that you are the owner or have the necessary\n    rights on the content that You transmit to Us; that at the date of its\n    transmission<br /><br />\n    • The content is exact and true<br />\n    • The use of the content does not contravene any of our policies and will\n    not be damaging to any third party (i.e. that the content is not defamatory)\n  </p>\n\n  <h3 class=\"legal-title\">5. How Secure is Information about Me?</h3>\n  <p class=\"legal-text\">\n    It is important for you to protect against unauthorized access to your\n    password and to your computer. Be sure to sign off when finished using a\n    shared computer.<br />\n\n    We work to protect the security of your information during transmission by\n    using Secure Sockets Layer (SSL) software, which encrypts information you\n    input.<br />\n\n    We reveal only the last four digits of your credit card numbers when\n    confirming an order. Of course, we transmit the entire credit card number to\n    the appropriate credit card company during order processing\n  </p>\n\n  <h3 class=\"legal-title\">6. Examples of Information Collected:</h3>\n  <p class=\"legal-text\">\n    •Information you give us: You provide most such information when you search,\n    buy, post, participate in a contest or questionnaire, or communicate with\n    customer service. For example, you provide information when you search for a\n    product; place an order through AfrimartOne.ng or one of our third-party\n    sellers; provide information in Your Account (and you might have more than\n    one if you have used more than one e-mail address when shopping with us) or\n    Your Profile; communicate with us by phone, e-mail, or otherwise; complete a\n    questionnaire or a contest entry form.<br /><br />\n    As a result of those actions, you might supply us with such information as\n    your name, address, and phone numbers; credit card information; people to\n    whom purchases have been shipped, including addresses and phone number;\n    e-mail addresses of your friends and other people; content of reviews and\n    e-mails to us; personal description and photograph in Your Profile ; and\n    financial information, including Social Security and driver's license\n    numbers.<br /><br />\n\n    • Automatic information: Examples of the information we collect and analyze\n    include the Internet protocol (IP) address used to connect your computer to\n    the Internet; login; e-mail address; password; computer and connection\n    information such as browser type, version, and time zone setting, browser\n    plug-in types and versions, operating system, and platform; purchase\n    history, which we sometimes aggregate with similar information from other\n    customers to create features like Top Sellers ; the full Uniform Resource\n    Locator (URL) clickstream to, though, and from our Web site, including date\n    and time; cookie number; products you viewed or searched for; and the phone\n    number you used to call our 800 number. We may also use browser data such as\n    cookies, Flash cookies (also known as Flash Local Shared Objects), or\n    similar data on certain parts of our Web site for fraud prevention and other\n    purposes. During some visits we may use software tools such as JavaScript to\n    measure and collect session information, including page response times,\n    download errors, length of visits to certain pages, page interaction\n    information (such as scrolling, clicks, and mouse-overs), and methods used\n    to browse away from the page. We may also collect technical information to\n    help us identify your device for fraud prevention and diagnostic\n    purposes.<br /><br />\n\n    • Mobile: Most mobile devices provide users with the ability to disable\n    location services. Most likely, these controls are located in the device's\n    settings menu. If you have questions about how to disable your device's\n    location services, we recommend you contact your mobile service carrier or\n    your device manufacturer.<br />\n\n    • Information from other sources: Examples of information we receive from\n    other sources include updated delivery and address information from our\n    carriers or other third parties, which we use to correct our records and\n    deliver your next purchase or communication more easily; account\n    information, purchase or redemption information, and page-view information\n    from some merchants with which we operate co-branded businesses or for which\n    we provide technical, fulfillment, advertising, or other services; search\n    term and search result information from some searches conducted through the\n    Web search features.<br />\n\n    If you are concerned about your data you have the right to request access to\n    the personal data which we may hold or process about you. You have the right\n    to require us to correct any inaccuracies in your data free of charge. At\n    any stage you also have the right to ask us to stop using your personal data\n    for direct marketing purposes.\n  </p>\n\n  <h3 class=\"legal-title\">7. Other Businesses</h3>\n  <p class=\"legal-text\">\n    AfrimartOne.ng does not take responsibility or liability for the actions,\n    products, content and services on AfrimartOne.ng website, which are linked\n    to Affiliates and / or third party websites using AfrimartOne.ng APIs or\n    otherwise.<br /><br />\n    In addition, AfrimartOne.ng may provide links to the third party websites of\n    affiliated companies and certain other businesses for which, AfrimartOne.ng\n    assumes no responsibility for examining or evaluating the products and\n    services offered by them, and AfrimartOne.ng does not warrant the offerings\n    of, any of these businesses or individuals or the content of such third\n    party website(s). AfrimartOne.ng does not in any way endorse any third party\n    website(s) or content thereof.\n  </p>\n\n  <h3 class=\"legal-title\">Return Policy</h3>\n  <p class=\"legal-text\">\n    How does our return policy work?<br /><br />\n    1. Initiate a return<br />\n    Call on 08139840866 if you have any questions. You can initiate a return if\n    you receive wrong, damaged, defective or counterfeit item.<br />\n    2. Prepare the item<br />\n    Place the item in its original packaging, including any accessories, tags,\n    labels or freebies. If you have created a password on the device you wish to\n    return, please ensure it is removed, otherwise, your return will be\n    invalid.<br />\n    3. Drop off your item<br />\n    Return the item at our pickup stations. Always ensure your return slip is\n    signed by our agents as your proof of return.<br />\n    4. Refund processed<br />\n    Once we receive your returned item, we will inspect it and process your\n    refund within 10 business days via voucher, wallet or bank transfer\n    depending on your selected option.\n  </p>\n  <h3 class=\"legal-title\">Items eligible for a Return</h3>\n  <p class=\"legal-text\">\n    You change your mind, with the exception of underwear, adult toys,\n    groceries, perfumes, cosmetics, hair extensions and jewelry. When returning\n    an item, ensure all seals, tags and accessories are left intact and item is\n    in it's original packaging. If you have created a password on the device you\n    wish to return, please ensure it is removed, otherwise, your return will be\n    invalid.\n  </p>\n</ion-content>\n";
